import React from 'react';
import ReactDOM from 'react-dom/client';
import WebPreLoader from './web_preloader.js';
import WebHeader from './web_header.js';
import OffCanvas from './web_offcanvas.js';

function GarapinWeb() {
    return (
        <React.StrictMode>
            <WebPreLoader />
            <WebHeader />
            <OffCanvas />
        </React.StrictMode>
    )
}

export default GarapinWeb;
